import * as React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { View, Text } from 'react-native';
import RegisterScreen from './screens/RegisterScreen';
import LoginScreen from './screens/LoginScreen';
import DepositForm from './screens/DepositForm';
import { AuthContext } from './context/AuthContext';

const Stack = createStackNavigator();

function TestScreen() {
  return (
    <View style={{ flex: 1, backgroundColor: 'red', justifyContent: 'center', alignItems: 'center' }}>
      <Text style={{ color: 'white', fontSize: 24 }}>Testing Render</Text>
    </View>
  );
}


export default function App() {
  return (
    <AuthProvider> {/* Provides authentication context to the entire application */}
      <NavigationContainer>
        <Stack.Navigator initialRouteName="Register">
          {/* Registration Screen */}
          <Stack.Screen 
            name="Register" 
            component={RegisterScreen || (() => <Text>RegisterScreen Not Found</Text>)} 
            options={{ title: 'Register' }}
          />

          {/* Login Screen */}
          <Stack.Screen 
            name="Login" 
            component={LoginScreen || (() => <Text>LoginScreen Not Found</Text>)} 
            options={{ title: 'Login' }}
          />

          {/* Dashboard Screen */}
          <Stack.Screen 
            name="Dashboard" 
            component={DepositForm || (() => <Text>DepositForm Not Found</Text>)} 
            options={{ title: 'Dashboard' }}
          />
        </Stack.Navigator>
      </NavigationContainer>
    </AuthProvider>

  );
}
